/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `add_pobyt_z_parkowaniem` AFTER INSERT ON `pobyty` FOR EACH ROW BEGIN
	INSERT INTO z_parkowaniem (id, miejsca_id) SELECT NEW.id, miejsca.id from miejsca 
		WHERE NEW.selektor = "z_parkowaniem" AND miejsca.id = (SELECT miejsca.id from miejsca WHERE miejsca.strefy_id = (SELECT strefy_id from bramki WHERE bramki.id = NEW.wjazdowe_bramki_id) AND miejsca.typy_pojazdów_id = (SELECT typy_pojazdów_id FROM pojazdy where pojazdy.rejestracja = NEW.pojazdy_rejestracja) AND miejsca.czy_wolne = 1 LIMIT 1);
	UPDATE pojemności SET miejsca_zajete = miejsca_zajete + 1
        WHERE strefy_id = (SELECT strefy_id FROM miejsca WHERE miejsca.id = (SELECT miejsca_id from z_parkowaniem WHERE NEW.id = z_parkowaniem.id)) AND typy_pojazdów_id = (SELECT typy_pojazdów_id FROM pojazdy WHERE pojazdy.rejestracja = NEW.pojazdy_rejestracja) 
			AND NEW.selektor = "z_parkowaniem";
	UPDATE miejsca SET czy_wolne = 0
		WHERE miejsca.id = (SELECT miejsca_id from z_parkowaniem WHERE NEW.id = z_parkowaniem.id) 
			AND NEW.selektor = "z_parkowaniem";
END */;;
