       WHERE strefy_id = (SELECT strefy_id FROM miejsca WHERE miejsca.id = (SELECT miejsca_id from z_parkowaniem WHERE NEW.id = z_parkowaniem.id)) AND typy_pojazdów_id = (SELECT typy_pojazdów_id FROM pojazdy WHERE pojazdy.rejestracja = NEW.pojazdy_rejestracja) 
			AND NEW.selektor = "z_parkowaniem";
	UPDATE miejsca SET czy_wolne = 1
